import React, { useEffect, useState } from 'react';
import { StyleSheet, Button, Text, View, Image, TextInput, Pressable, ActivityIndicator} from 'react-native';
import * as Crypto from 'expo-crypto';

import constantes from '../../constantes';
import {userContext} from '../../contexts/userContext';
import styles from '../../styles';


export default function IdScreen({navigation}) {
  const [textEmail, onChangeTextEmail] = React.useState('');
  const [textPassword, onChangeTextPassword] = React.useState('');
  const [data, setData] = React.useState('');
  const [hash, setHash] = React.useState('');
  const [loading, setLoading] = React.useState(false);
  
  const changeID = React.useContext(userContext).changeID;
  
  function checkPassword() {
	if (textEmail != '' && textPassword != '') {
		setLoading(true);
		fetch('http://' + constantes.BDD + '/Axoptim.php/REQ/AP_ACCES_BEN/P_EMAIL=' + textEmail) //A changer
		  .then((response) => response.text())
		  .then((texte) =>  {setData(texte);setLoading(false);})
		  .catch((error) => {
			(setData(-1));
			setLoading(false);
		  });
		Crypto.digestStringAsync(
			Crypto.CryptoDigestAlgorithm.SHA256,
			textPassword
		  )
		.then((hash1) => setHash(hash1))
		.catch();
		onChangeTextPassword(''); //On vide le champ mot de passe
	}
  }
  
  useEffect(() => {
	if (data != "" && hash != "") {
	  const hPassword = getPasswordFromData(data);
	  if (hPassword != null) {
		  if (hPassword === hash) {
			  changeID(getIDFromData(data));
		  }
		  else {
			alert("Mot de Passe incorrect !");
		  }
	  }
	  else {
		  alert("Identifiant incorrect");
	  }
	  setData("");
	  setHash('');
	}
	
  }, [data,hash]);
  
  function getPasswordFromData(data) {
	const lignes = data.split(/\n/);
	var i;
	var hPassword = null;
	for (i = 1; i<lignes.length; i++){
		if (lignes[i] != ""){
			const valeurs = lignes[i].split(/\t/);
			hPassword = valeurs[2];
		}
	}
	return hPassword;
  }
  
  function getIDFromData(data) {
	const lignes = data.split(/\n/);
	var i;
	var ID = null;
	for (i = 1; i<lignes.length; i++){
		if (lignes[i] != ""){
			const valeurs = lignes[i].split(/\t/);
			ID = valeurs[3];
		}
	}
	return ID;
  }
  
  return (
    <>
    <View style={[styles.container,{alignItems: "center"}]}>
	  <Image
		style={styles.logo}
        source={{
          uri: 'data:image/png;base64,'
        }}
      />
      <Text>Adresse mail</Text>
	  <TextInput
		style={styles.idInput}
		placeholder="votre@email.fr"
		onChangeText={onChangeTextEmail}
		keyboardType = "email-address"
		textContentType = "emailAddress"
		autoCompleteType = "email"
		autoCorrect = {false}
	  />
	  <Text>Mot de passe</Text>
	  <TextInput
		style={styles.idInput}
		placeholder="********"
		secureTextEntry = {true}
        onChangeText={onChangeTextPassword}
		value={textPassword}
		textContentType = "password"

	  />
	  <Button
		onPress = {() => checkPassword()} //{() => navigation.navigate('Engagements')}
		title="CONNEXION"
		color="#841584"
		accessibilityLabel="Bouton de connexion"
	  />
	  <Pressable title = "mdp" onPress = {() => navigation.navigate("Oublie")} style={styles.idTexte}>
		<Text>Mot de passe oubli ?</Text>
	  </Pressable>
	  	
    <Button
	  onPress = {() => changeID(constantes.IDDebug)}
	  title="PASSER"
	  color="#041584"
    />
    </View>
	{loading &&
    <View style={styles.loading}>
      <ActivityIndicator size="large" color="#00ff00" />
    </View>
	}
    </>
  );
}